n = p*q
phi = (p-1)*(q-1)

# Took from SO -ofaurax
def egcd2(a, b):
    if a == 0:
        return (b, 0, 1)
    g, y, x = egcd2(b%a,a)
    return (g, x - (b//a) * y, y)

def modinv(a, m):
    g, x, y = egcd2(a, m)
    if g != 1:
        raise Exception('No modular inverse')
    return x%m

e = 65537

d = modinv(e, phi)

print('P =', p)
